import "./App.css";
import Counter from "./components/Counter";
import BuggyCounter from "./components/BuggyCounter";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BuggyCounter>
          <Counter />
        </BuggyCounter>
      </header>
    </div>
  );
}

export default App;
